import React from "react";

const frame = [
  {
    title: "Shop by Categories",
  },
  { title: "Steel Tmt bars" },
  { title: "cement" },
  { title: "flyash" },
  { title: "Steel TMT Bars" },
  { title: "Construction chemicals" },
  { title: "Aggregrate & Sands" },
  { title: "Bricks & Blocks" },
];

const Frame = () => {
  return (
    <div className="Frame w-[100%] h-auto">
      <div className="inline-flex flex-col display:block ">
        <div className="inline-flex ring-1 flex-row-4 display:block">
          {frame.map((k, i) => {
            return <span key={i}>{k.line}</span>;
          })}
        </div>
        <div className="inline-flex ring-1 flex-row-4 display:block"></div>
      </div>
    </div>
  );
};

export default Frame;
